import React from "react";
import "./navbar.css";

export default class Navbar extends React.Component {

    componentDidMount() {
        const Ulkitscript1 = document.createElement("script");
        Ulkitscript1.src = "https://cdn.jsdelivr.net/npm/uikit@3.10.1/dist/js/uikit.min.js";
        Ulkitscript1.async = true;

        const Ulkitscript2 = document.createElement("script");
        Ulkitscript2.src = "https://cdn.jsdelivr.net/npm/uikit@3.10.1/dist/js/uikit-icons.min.js";
        Ulkitscript2.async = true;

        document.body.appendChild(Ulkitscript1);
        document.body.appendChild(Ulkitscript2);

    }

    render() {

        return (
            <section id="nav-section">

                <div uk-sticky="sel-target: .uk-navbar-container; cls-active: uk-navbar-sticky; bottom: #transparent-sticky-navbar">
                    <div id="bgimg">

                        <div className="uk-container" id="top-bar">

                            <div className="uk-child-width-1-2@m uk-grid-small uk-grid-match" uk-grid="true">
                                <div>
                                    <div className="uk-card feature-card  uk-card-body">
                                        <h3 className="uk-card-title"> <img alt="" src="https://img.icons8.com/fluency/48/000000/confectionery.png" />  Sweet Cups Bangalore </h3>

                                        <div class="uk-child-width-expand@s uk-text-center" uk-grid='true'>
                                            <div>
                                                <button class="uk-button uk-button-text"> Home </button>
                                            </div>
                                            <div>
                                                <button class="uk-button uk-button-text"> About </button>
                                            </div>

                                            <div>
                                                <button class="uk-button uk-button-text"> Gallery </button>
                                            </div>

                                            <div>
                                                <button class="uk-button uk-button-text"> Contact </button>
                                            </div>
                                            <div>
                                                <button class="uk-button uk-button-text"> Services </button>
                                            </div>
                                        </div>

                                    </div>
                                </div>
                                <div>
                                    <div className="uk-card uk-card-default feature-card uk-card-body">
                                    <img alt="" src="https://img.icons8.com/office/100/000000/virtual-reality.png"/> 
                                    <h3 className="uk-card-title"> Wanna See us? </h3>
                                        <p> click <a>here!</a> </p>
                                    </div>
                                </div>
                            </div>


                        </div>


                    </div>
                </div>

            </section>
        )

    }

};
